import { bindActionCreators } from "redux";
import { connect } from "react-redux";
import { MediaComponentView } from "./view";
import {updateWordFinished} from '../../../actionCreators/wordFinishedActionCreator';

const mapStateToProps = (state, props) => {
    return {
        word: props.word,
        wordFinished: props.wordFinished
    };
};

const mapDispatchToProps = dispatch => {
    return bindActionCreators({updateWordFinished}, dispatch);
};

export default connect(mapStateToProps, mapDispatchToProps)(MediaComponentView);
